011-01-07 20:42:51',0,'    AVRO-723. Java: Pass error messages for unexpected RPC exceptions through to client.  Contributed by Stephen Gargan.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1056499 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,8),(684,'ee5428d3eb38c34ef2a9ded2f0cd447fe3f2f959',12,12,'2011-01-07 21:19:36',0,'2011-01-07 21:19:36',0,'    AVRO-719. Java: Permit MapReduce programs to alter output file sync interval.  Contributed by Joe Crobak.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1056517 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,4),(685,'a0d444d9eb8ffac43ecabb7476f80cbae998170a',12,12,'2011-01-07 21:23:55',0,'2011-01-07 21:23:55',0,'    AVRO-694. Python: Fix schema parse error for maps of records.  Contributed by hammer.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1056519 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,3),(686,'161206d6d49f352e1a9158f884c8020709f5b1ff',10,10,'2011-01-11 14:32:37',0,'2011-01-11 14:32:37',0,'    AVRO-725. Add avro_schema_get_subschema function.\n    \n    This new function returns the immediate subschema with the given name.\n    For records, this is the name of the field.  For unions, it\'s the name\n    of the branch\'s schema type.  For arrays and maps, there is a single\n    special name (respectively \"[]\" and \"{}\") that represents the item or\n    value subschema.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1057661 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,6),(687,'02fc973f779bc18482554841abc43844562da75a',10,10,'2011-01-11 14:48:26',0,'2011-01-11 14:48:26',0,'    AVRO-630. Size accessors for array and map data.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1057667 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,4),(688,'8028574ba42ff2aa8d1faf4085f84ca3d13d55b3',10,10,'2011-01-11 14:56:51',0,'2011-01-11 14:56:51',0,'    AVRO-727. This patchs several missing accessor and mutator methods for Avro\n    schemas and data instances.\n    \n    For the most part, their definitions are straightforward.  Some notes for the\n    more interesting cases:\n    \n      - You can create the appropriate avro_datum_t instance for an\n        arbitrary schema with the new avro_datum_from_schema() function.\n        For records, this includes creating a datum instance for each of the\n        record\'s fields.  Arrays and maps are initially created empty, while\n        a union is created with none of its branches initially selected.\n        This prevents the function from going into an endless loop for\n        recursive schemas.\n    \n      - The active branch of a union can now be changed.  If the desired\n        branch is already active, this has no result.  Otherwise, a new\n        avro_datum_t is created for the new branch.\n    \n      - Map values can now be accessed by index as well as by key.  The\n        index of a map entry is based on the order that it was added to the\n        map.\n    \n      - Enum values can be retrieved or set either by integer value or by\n        symbol name.\n    \n    A couple of the new functions need access to the schema of a datum in\n    order to work.  These functions take in the schema instance as an extra\n    parameter.  A better solution might be to include a reference to a\n    schema object in each avro_datum_t instance.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1057676 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,8),(689,'7febb30db2f2038ab9b750457a6df016cd583a04',10,10,'2011-01-11 15:07:07',0,'2011-01-11 15:07:07',0,'    AVRO-549. Custom allocator interface.\n    \n    You can now provide a custom allocation function, which the Avro library\n    will use for all of the memory that it obtains.  The allocator function\n    prototype is the same one used by the Lua interpreter; it\'s a generic\n    function that includes the functionality of malloc, realloc, and free.\n    It takes in the old pointer (ptr), the old size (osize), and the new\n    size (nsize) of the buffer.  For realloc, all three have real values.\n    For malloc, ptr will be NULL, and osize 0.  For free, nsize will be 0.\n    \n    One wrinkle is that we have to be able to provide the allocated size of\n    the buffer when we free it, since we have to provide a value for osize.\n    For most of our allocations, this isn\'t a problem, since we allocated a\n    fixed-size buffer for a struct of some kind.  It\'s also not a problem\n    for the buffers associated with a bytes or fixed field, since we have\n    the buffer size right there.  For strings, however, we have to be more\n    clever; for most cases, our strdup replacement adds additional space to\n    the buffer to store its size.  This prevents us from having to add lots\n    of additional size_t fields all over the place.  We can\'t do this in the\n    string datum, however, since the givestring methods need to be able to\n    take in an arbitrary string pointer; this means we can\'t assume it has\n    our special size prefix.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1057683 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,16),(690,'44eb7b879277cd5be5fa3f23376d299d8f4a6067',10,10,'2011-01-11 15:34:44',0,'2011-01-11 15:34:44',0,'    AVRO-729. avro_schema_to_json can take const schema.\n    \n    This method doesn\'t modify the schema as it writes its JSON encoding, so\n    the schema parameter can be const.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1057697 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,3),(691,'2a3841f9419723b3007832d368a8c365d89ffd17',10,10,'2011-01-11 16:50:35',0,'2011-01-11 16:50:35',0,'    AVRO-729. Part 1 of updating to Jansson 1.3.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1057727 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,367),(692,'8bb68f7949fa14c10fd2549bcae2e4ddfdb817da',10,10,'2011-01-11 16:53:53',0,'2011-01-11 16:53:53',0,'    AVRO-729. Upgrading to Jansson 1.3\n    \n    This patch updates our internal copy of the Jansson library to version\n    1.3.  This is needed for the new code that will decode and encode JSON\n    versions of an Avro datum.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1057728 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,60),(693,'c69a5bb3780fcae1ca02439ef03c2f2d6188774b',10,10,'2011-01-11 17:15:49',0,'2011-01-11 17:15:49',0,'    AVRO-729. Follow-on to address issues when building with CMake.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1057735 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,3),(694,'2f5d854451fc832fda13e170323c065c9b048c3c',10,10,'2011-01-11 17:16:12',0,'2011-01-11 17:16:12',0,'    AVRO-729. JSON encoded Avro values.\n    \n    You can now produce the JSON-encoded version of an Avro datum.  It\n    correctly handles Avro values that produce a top-level JSON object that\n    isn\'t an array or object, even though that technically violates the JSON\n    spec.  You have to free the resulting string using the standard free()\n    function, and *not* using the custom Avro allocator, since the string\n    will be produced by the Jansson library, which doesn\'t know about our\n    custom allocator.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1057736 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,6),(695,'d88f0e4b854b5317555ad2a08c2c0b8ce4fe5b90',10,10,'2011-01-11 17:46:30',0,'2011-01-11 17:46:30',0,'    AVRO-729. Follow-on to set some permissions correctly.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1057764 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,7),(696,'a2d92d73cdc29f92091ac958511ffef36d2f9e1f',10,10,'2011-01-11 18:16:35',0,'2011-01-11 18:16:35',0,'    AVRO-729. Follow-on to fix further issues from Jansson update.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1057781 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,6),(697,'fe2631a02ad01d755199076f43398a