vro/trunk@1059141 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,1),(704,'f46af6b5788544d8789bec5e8fdeb58d9d9d2d47',11,11,'2011-01-14 19:55:43',0,'2011-01-14 19:55:43',0,'    AVRO-734. Java: Update maven build plugin versions.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1059146 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,1),(705,'914bdb53b61b9b65e3260459217bdf6063b9b83b',11,11,'2011-01-14 23:07:05',0,'2011-01-14 23:07:05',0,'    AVRO-733 Java: change checkstyle to be bound to \'test\' rather than \'verify\' phase\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1059204 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,1),(706,'a1eb97af3d931594b450321eb277817d186e1f50',12,12,'2011-01-17 20:57:54',0,'2011-01-17 20:57:54',0,'    AVRO-688. Java: Only require that one-way\'ness of messages match over stateful connections.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1060089 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,4),(707,'baab72449d90842142032a6cc668c52d855de716',11,11,'2011-01-18 05:10:31',0,'2011-01-18 05:10:31',0,'    AVRO-647 remove inappropriately added eclipse project files\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1060190 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,6),(708,'c849a8f76708f8995c311396f3933421b80bdaa7',10,10,'2011-01-20 11:35:56',0,'2011-01-20 11:35:56',0,'    AVRO-740. Fix early deletion of schema during test_avro_data.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1061232 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,1),(709,'b4f29d127108be85af3ea0f856c4ef3b52a2a798',10,10,'2011-01-20 12:38:19',0,'2011-01-20 12:38:19',0,'    AVRO-736. At least let valgrind run test_avro_data on Mac OS X.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1061269 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,1),(710,'a1e801aadba4ba65ce54b078d6c02b8617a88774',10,10,'2011-01-24 12:05:09',0,'2011-01-24 12:05:09',0,'    AVRO-742. Maintain reference count for singleton objects.\n    \n    We use a singleton struct for instances of the null value type, and for\n    each of the primitive schema types.  This means that we need to increase\n    the reference count of each singleton each time the appropriate\n    constructor is called; otherwise, the reference count will get wonky\n    when we call avro_whatever_decref().  That won\'t cause any memory\n    corruption, since we never free any singleton objects, regardless of\n    what their reference counts do, but still.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1062747 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,2),(711,'26ea6ca388642f96d4d0dfab28150d6b0f51aa33',10,10,'2011-01-24 12:09:17',0,'2011-01-24 12:09:17',0,'    AVRO-736. Fix running test_valgrind on Mac OS X. No need for --show-reachable=yes.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1062748 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,1),(712,'335d72590281875b500f776afd3b43fc24c1e4dc',10,10,'2011-01-24 16:52:09',0,'2011-01-24 16:52:09',0,'    AVRO-745. Fixed memory bug in bytes/string/fixed values.\n    \n    The avro_bytes_set function (and its string and fixed counterparts) are\n    supposed to save a copy of the value, which the avro_datum_t instance\n    takes full control over.  Unfortunately, we were making that copy but\n    then saving the original pointer, which would lead to a segfault when\n    freeing the datum.  Whoops...\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1062872 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,2),(713,'bd1c8fedb2c9566a9b161749fb6b49904b8caad8',10,10,'2011-01-26 03:44:18',0,'2011-01-26 03:44:18',0,'    AVRO-741. The avro_give* functions now all take in a custom free function that\n    will be called once the datum no longer needs access to the underlying\n    buffer.  This gives complete flexibility over wrapping external buffers\n    into Avro datum instances.  The avro_wrap* functions have been removed,\n    since this is now just a special case  just use NULL for the free\n    function.  To get the previous behavior of avro_give* (where the buffer\n    is freed using the custom allocator), use avro_alloc_free as the free\n    function.\n    \n    In addition to updating the give functions, the binary encoding class\n    now ensures that any bytes value is NUL terminated in memory.  This\n    fixes the bug in AVRO-741, where we were getting a segfault when trying\n    to parse a schema JSON directly from a bytes value.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1063596 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,11),(714,'9403bef4294b16c9eb59e6876f7a6fb6cecfaa0a',11,11,'2011-01-28 01:04:53',0,'2011-01-28 01:04:53',0,'        AVRO-716. Java: Improve correlation between packages and modules.\n        Each module introduced by AVRO-647 now exclusively provides\n        different java packages.  This required moving several classes\n        around into new packages and will therefore require users to\n        change their package imports when upgrading to Avro 1.5.0.\n        Summary of changes:\n        * AvroRemoteException has moved to org.apache.avro\n        * ByteBufferInputStream and ByteBufferInputStream have moved\n          to org.apache.avro.util\n        * InduceSchemaTool has moved to org.apache.avro.tools\n        * SpecificCompiler, SchemaTask, and ProtocolTask have moved\n          to org.apache.avro.compiler.specific\n        * The Idl compiler has moved to org.apache.avro.compiler.idl\n        * ReflectRequestor and ReflectResponder have moved to\n          org.apache.avro.ipc.reflect\n        * GenericRequestor and GenericResponder have moved to\n          org.apache.avro.ipc.generic\n        * SpecificRequestor and SpecificResponder have moved to\n          org.apache.avro.ipc.specific\n        (scottcarey)\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1064397 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,73),(715,'330e7fb6c2708b4dba775d9bad05a62b0ce2146e',5,5,'2011-01-30 19:10:51',0,'2011-01-30 19:10:51',0,'    AVRO-700. Change C++ build system to CMake\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1065352 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,9),(716,'7fedde60b8704c2715526f6da81d6c43c4ca03e3',10,10,'2011-01-31 12:29:27',0,'2011-01-31 12:29:27',0,'    AVRO-749. Don\'t install Jansson files.\n    \n    Our copy of the Jansson library should be strictly internal, but the\n    autotools build was installing Jansson\'s include and pkg-config files\n    along with the Avro library.  Now it doesn\'t.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1065580 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,3),(717,'5ca4688a84af2406da81c0915ef781a790a016cb',11,11,'2011-02-01 19:08:24',0,'2011-02-01 19:08:24',0,'    AVRO-752. Java: Enhanced Performance Test Suite\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1066139 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,2),(718,'bb9b1c9796fab5960839e5b3eb8ff53b036eb6ad',12,12,'2011-02-01 19:20:59',0,'2011-02-01 19:20:59',0,'    AVRO-737. Fix bug number in change log.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1066154 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,1),(719,'214803f7333fa6681caf0c36abf5899b7e861992',11,11,'2011-02-01 19:24:40',0,'2011-02-01 19:24:40',0,'    AVRO-716. Java: integrate AVRO-647 changes with top level build\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1066155 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,23),(720,'9a34604d54723f44660d71d3e0ecd609fbf7d8a1',11,11,'2011-02-07 18:37:16',0,'2011-02-07 18:37:16',0,'    AVRO-743 Java: Performance Regression and memory pressure with GenericDatumReader\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1068045 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,2),(721,'0011118ad62f56a42559fb432c2d46155649ade9',12,12,'2011-02-07 21:21:01',0,'2011-02-07 21:21:01',0,'    AVRO-757. Java: Permit data files to be re-opened without re-reading the header.  Contributed by Stu Hood.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1068142 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,5),(722,'e020bbab1ba977e7b2f0cd0693d0d20c2c73441f',11,11,'2011-02-09 01:38:00',0,'2011-02-09 01:38:00',0,'    AVRO-752. Java: Enhanced Performance Test Suite\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1068726 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,1),(723,'555df469c341e8aedc6a4a2822735edeed8ec095',11,11,'2011-02-14 19:10:52',0,'2011-02-14 19:10:52',0,'    AVRO-765. Java: Improvement to BinaryDecoder readLong performance\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1070613 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,2),(724,'4becf049d94e442f0b7aed95d61cc7574454f96c',13,13,'2011-02-15 15:26:23',0,'2011-02-15 15:26:23',0,'    AVRO-750. C: Install pkg-config file\n    \n    This patch adds a pkg-config description file for the Avro library.\n    Makes it easier to determine the right CPPFLAGS and LDFLAGS needed to\n    use the library.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1070935 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,5),(725,'c6469bfc32c0ebd53439b42feebc28439ac04506',13,13,'2011-02-15 15:40:18',0,'2011-02-15 15:40:18',0,'    AVRO-744. C: Helper macros for extracting and setting record field values\n    \n    This patch adds two helper macros that can be used to extract or set the\n    value of a record field using fewer function calls.  It wraps a call to\n    avro_record_get, which extracts the avro_datum_t instance for the field,\n    and a call to avro_XXX_get or avro_XXX_set on the field datum.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1070941 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,3),(726,'9075618bf7890a8761107fa96da92dedf73d8a3e',12,12,'2011-02-15 21:49:20',0,'2011-02-15 21:49:20',0,'    AVRO-759. 