e one-way behavior.\n    \n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1099257 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,5),(861,'3eb8a8c93c9388d1bd79b2297118a1d381bde51d',14,14,'2011-05-04 00:21:09',0,'2011-05-04 00:21:09',0,'    Added comment for Avro-815 to fixes section for 1.6.0\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1099303 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,1),(862,'fbab55fdd499dae4736f099111aecf2bc8e488e3',13,13,'2011-05-12 14:57:27',0,'2011-05-12 14:57:27',0,'    AVRO-818. C: Fix data file corruption bug\n    \n    This patch fixes the C library\'s data file writer to produce correct\n    files when there are enough records to produce multiple blocks in the\n    file.  The logic in datafile.c is that we have a fixed-buffer in-memory\n    avro_writer_t instance.  When you append records to the data file, they\n    go into this memory buffer.  If we get an error serializing into the\n    memory buffer, it\'s presumably because we\'ve filled it, so we write out\n    the memory buffer\'s contents as a new block in the file, clear the\n    buffer, and try again.\n    \n    The problem is that the failed serialization into the memory buffer\n    isn\'t atomic; some of the serialization will have made it into the\n    buffer before we discover that there\'s not enough room.  Before, this\n    incomplete record would then make it into the file.  To fix this, we\n    keep track of the size of the in-memory buffer after the most recent\n    successfully serialized record, and use this as the block size when we\n    write a block to disk.  This ensures that even if there\'s any incomplete\n    records at the end of the memory buffer, we don\'t include them in the\n    block.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1102332 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,4),(863,'947bd7daab9ac512bba06f09d27f9dd29b55bef7',13,13,'2011-05-12 15:06:02',0,'2011-05-12 15:06:02',0,'    AVRO-819. C: Fix file reader EOF detection\n    \n    This patch fixes a bug that Miki Tebeka discovered in the file reader\n    code.  Errors weren\'t getting propagated correctly through the call\n    stack.  This caused the file reader to not correctly detect EOF, and so\n    you\'d loop through the final block in a file twice.  (The second time\n    through, we wouldn\'t fill in the datum instance.)\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1102335 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,2),(864,'85bc4f8916fa5db77b6ac3d78747e98844780d04',12,12,'2011-05-16 13:35:41',0,'2011-05-16 13:35:41',0,'    AVRO-815. Remove tabs that cause checkstyle to fail.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1103731 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,1),(865,'ac835f5458ee587f937312bb1eeb3b70699d3aee',12,12,'2011-05-18 09:23:24',0,'2011-05-18 09:23:24',0,'    update CHANGES.txt in trunk to reflect what\'s been merged to the 1.5 branch\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1124125 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,1),(866,'e05d7e823c8b05c18d4245b894eb43db66df21b6',12,12,'2011-05-18 09:25:18',0,'2011-05-18 09:25:18',0,'    AVRO-809.  Fix reflect for classes that have no package.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1124127 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,3),(867,'1dbd63f4d14887ad4f7ac4c74db576f336b8c95f',12,12,'2011-05-18 09:28:17',0,'2011-05-18 09:28:17',0,'    no incompatible changes in 1.5.2\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1124130 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,1),(868,'ea05ebd20d8ae1fc7e6cdfa64c6a40c204d728fe',12,12,'2011-05-19 15:50:40',0,'2011-05-19 15:50:40',0,'    AVRO-820. Java: Permit applications to catch exceptions thrown while writing data to a file and then continue writing to that file.  Contributed by scottcarey.\n    \n    git-svn-id: https://svn