6-ffa450edef68\n',0,1,4),(939,'fd02845b1307edba65587a6e2cefda72e54ed8b9',12,12,'2011-09-26 21:14:35',0,'2011-09-26 21:14:35',0,'    AVRO-890: Java: Add Maven archetype for creating Avro service projects.  Contributed by Stephen Gargan.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1176060 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,15),(940,'d6d8e36128e1b733b520abfc2f6687914e0cd9e0',12,12,'2011-09-29 23:35:23',0,'2011-09-29 23:35:23',0,'    AVRO-899. C#: Include binary artifacts and documentation in releases.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1177464 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,6),(941,'21223692e8066b2bdf2100641fb7befdae453e8e',5,5,'2011-10-01 18:37:14',0,'2011-10-01 18:37:14',0,'    AVRO-895. JsonDecoder does not tolerate JSON records with different field order\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1178066 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,6),(942,'2b4a20cddc3856755e1104775398c5d95d7570d5',12,12,'2011-10-03 19:46:05',0,'2011-10-03 19:46:05',0,'    AVRO-898.  Java: Extend NettyServer to support SSL.  Contributed by Vadim Tsarik.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1178536 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,2),(943,'ce9db305e58824d3f892a9fe89c38537f7e75a39',12,12,'2011-10-03 19:47:29',0,'2011-10-03 19:47:29',0,'    Whitespace fixups.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1178538 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,1),(944,'3f01ca6b4de96fc5b9167651d4f700b2fcb2c5f4',12,12,'2011-10-04 21:54:25',0,'2011-10-04 21:54:25',0,'    AVRO-804. Java: Add support for reading and writing instances of Thrift generated classes.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1178973 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,17),(945,'126e9769f45f978f42321c4fc465198982df482b',12,12,'2011-10-05 18:11:01',0,'2011-10-05 18:11:01',0,'    AVRO-906. Java: Fix so that ordering of sc