m a thread or coroutine with a 64K stack.\n    This patch moves the scratch buffer into the avro_file_writer instance\n    itself; we\'re already allocating that from the heap, and it\'s easy\n    enough to add the 64K buffer to the end of the type.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1331813 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,2),(1104,'acfa07feb6b47e554d14429c3c98a8810ac3be42',12,12,'2012-05-08 21:21:21',0,'2012-05-08 21:21:21',0,'    AVRO-1071.  Fix change log to correctly cite AVRO-656, not AVRO-246.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1335778 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,1),(1105,'6cf7a47b16039ee50cd616eedf23e8e166d457e4',12,12,'2012-05-08 21:43:48',0,'2012-05-08 21:43:48',0,'    AVRO-1075. Add some Eclipse stuff to .gitignore.  Contributed by Karthik K.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1335784 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,2),(1106,'34ece34c097347fd06b0e4f717d5d102266e25ff',5,5,'2012-05-09 07:35:47',0,'2012-05-09 07:35:47',0,'    AVRO-1070. AvroSequenceFileOutputFormat is in wrong package.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1335954 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,2),(1107,'6eb2c5801e9029b22e5800a86986bde03d5541b9',5,5,'2012-05-09 08:33:38',0,'2012-05-09 08:33:38',0,'    AVRO-1080. JsonIO.cc should allow \\u escape sequence in string\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1335985 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,3),(1108,'b50ab97269c4c52bf45db27d5b54e0d6e0e4154c',5,5,'2012-05-11 18:07:25',0,'2012-05-11 18:07:25',0,'    AVRO-1066. ArrayIndexOutOfBoundsException in ParsingEncoder when trying to use a json encoder to serialize a deep object graph\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1337322 13f79535-47bb-0310-9956-ffa450edef68\n',0,1,3),(1109,'563afdbf1e35b7d12723d0c88562a8f277ddd353',5,5,'2012-05-13 17:28:18',0,'201