1,25,'2016-05-14 16:43:04',-25200,'2015-12-09 16:01:59',-18000,'    AVRO-1493: Java: Schema fingerprint vary by locale\n',0,1,3),(1628,'1bc650dd6dbe7e87c59553e13f037481ee50abb6',21,21,'2016-05-14 16:43:06',-25200,'2016-02-21 18:16:07',-28800,'    AVRO-1799: Fix GenericRecord#toString ByteBuffer bug.\n    \n    Reading the ByteBuffer to return a string representaton modified the\n    buffer\'s position. The solution is to duplicate the buffer before\n    reading its content.\n',0,1,3),(1629,'cb3e24b5bb3ec9049a0e7258003e09f1bddfad6f',21,21,'2016-05-14 16:43:06',-25200,'2016-03-06 19:09:58',-28800,'    AVRO-1667: Fix parser grammar flattening for recursive cases. Contributed by Zoltan Farkas.\n    \n    Recursive records use a Fixup class to copy sequences of parser Symbols\n    because the final sequence isn\'t yet known. But these weren\'t being\n    copied when the sequences being fixed up were copied, which caused the\n    final grammar to have nulls in some cases.\n',0,1,3),(1630,'9d3bcfa2f7a39ec6136baab18286a3d6006e4df7',21,21,'2016-05-14 16:43:06',-25200,'2016-04-09 15:46:28',-25200,'    AVRO-1824: C++: Update required packages in docs. Contributed by William S. Fulton.\n',0,1,2),(1631,'6dbaf6af9bd32fa31dfefdde199f16d9892127ee',21,26,'2016-05-14 16:43:06',-25200,'2016-04-13 10:53:29',19080,'    AVRO-1784. C++: Should have a json encoder that pretty prints\n',0,1,8),(1632,'7251072c317cea12cb4bf6056d7149d82516db73',21,26,'2016-05-14 16:43:06',-25200,'2016-04-13 11:32:28',19080,'    AVRO-1701: Fix for \"warning: comparison between \'const enum testgen_r::ExampleEnum\' and \'const enum testgen::ExampleEnum\"\n',0,1,2),(1633,'60450656cb3bdddb73a322d24be27aeb854738b8',21,5,'2016-05-14 16:43:06',-25200,'2016-04-16 08:46:05',19080,'    AVRO-1829. C++ documentation improvements\n',0,1,2),(1634,'ec8a091819a25bccf03adc868449f57f9c076d19',21,21,'2016-05-14 16:43:06',-25200,'2016-04-16 14:10:45',-25200,'    AVRO-1821: Fix possible memory leak of Schemas in ReflectData. Contr